$(document).ready(function(){
  $('#notifications').on("click", function() {
    $('.badgeAlert').remove();
  });
  $('.notification > a').on('click', function() {
    console.log("abc");
  })
  $( ".notification > a" ).css( "border", "3px double red" );
})
